import React from 'react';

const Trade = props => {
  const { trade } = props;


  /*
        buyDate,
      sellDate,
      buyPrice: myBag["buy-price"],
      sellPrice,
      numShares,
      profitPercent: +percentChange-1,
      profitUSD,
      candleLength,
      indicatorAtSell: curIndicatorValue,
      indicatorAtBuy: myBag["indicator-at-buy"]

      */
  return (
    <div className='row'>
      <div className='card w-50 text-danger'>
        Purchase date:<br/>
        {trade.buyDate}<br/>
        Sell date:<br/>
        {trade.sellDate}
      </div>
      <div className='card w-50 text-info'>
        Purchase price:<br/>
        {trade.buyPrice}<br/>
        Sell price:<br/>
        {trade.sellPrice}
      </div>
    </div>
  )
}

export default Trade;
